const PublicRoute = ({

  isAuthenticated, 
  component:Component, 
  ...rest
}) => {

  return (
    <Route {...rest}
      component={(props)=>(
        (!isAuthenticated) &&
          <Component {...props}/>
      )}
    />
  )
}



